description.narrative:
Project EIS strengthens institutional and training capacity of police and judiciary to end impunity of perpetrators and support survivors of sexual and gender based violence (SGBV) in Uganda.

Whilst a start has been made by the NICHE-GLR-258 project in the region, the appropriate skills and knowledge to handle SGBV cases and have perpetrators prosecuted successfully are not yet widely available in the police and judicial sector in Uganda.

Through Project EIS, crucial training institutions for police and judiciary officers are equipped with the capacity to better address cases of SGBV in order to prosecute perpetrators and treat SGBV survivors with the sensitivity they deserve. This is done through two output areas focusing on:
1. Research, including:
- Training in research methods and skills;
- Formative research and baseline assessment;
- Setup of resource/learning centre;
- Preliminary Impact Assessment. 
2. Training, including:
- Education and exposure for key actors;
- Curriculum design per target group;
- Manual development;
- Training of trainers;
- Training of officers.

By creating better access to knowledge on SGBV (Output 1) and by providing necessary skills to key officers in the police and judicial sectors (Output 2) a crucial contribution will be made in the fight against SGBV. As such, Project EIS translates into justice for perpetrators and survivors of sexual and gender based violence through improved service delivery.
